import { IonHeader, IonTitle, IonToolbar } from '@ionic/react'
import React from 'react'

const HeaderComponent = () => {
    return (
        <IonHeader>
            <IonToolbar>
                <IonTitle>Marriage Point Calculator</IonTitle>
            </IonToolbar>
        </IonHeader>
    )
}

export default HeaderComponent
